import React from 'react'

const Header = ({headerClick}) => {
    return (
        // <div classNameName="navbar">
        //  <a classNameName="btn-link" href="#" onClick="{headerClick}">Home</a>
        //  <a classNameName="btn-link" href="#">About</a>
        //  <a classNameName="btn-link" href="#">Certification</a>
        // </div>

        <nav className="nav bd-container">
        <a href="#" className="nav__logo">Gulraiz</a>

        <div className="nav__menu" id="nav-menu">
          <ul classNameName="nav__list">
            <li className="nav__item">
              <a href="#about" className="nav__link">About</a>
            </li>
            <li className="nav__item">
              <a href="#work" className="nav__link">Work</a>
            </li>
            <li className="nav__item">
              <a href="#services" className="nav__link">Services</a>
            </li>
            <li className="nav__item">
              <a href="#contact" className="nav__link">Contact</a>
            </li>
          </ul>
          </div>
          </nav>

    )
}

export default Header
